  input: 'TEXT,F3XA,,"Ms. Alice Kang - We are in receipt of your March 13, 2002, letter
    requesting clarification or amendment to the Bracewell & Patterson, L.L.P. Political
    Action Committee (''B&P PAC''), I.D. No. C00021295, 2001 Year-End Report.  You
    state that your review raised questions concerning certain information contained
    in the report relating to: (1) a refund contribution on Schedule A supporting
    Line 16 of the Detailed Summary Page; and (2) the need to amend Schedule B supporting
    Line 23 by providing the office sought for the contribution made.  With respect
    to the first matter, B&P PAC did receive a refund from a Federal Committee totaling
    $1,000.00.  The original contribution was cashed by the Federal Committee and
    a refund check written on its account to the B&P PAC.  Please accept this statement
    as clarification regarding the transaction, and thus an amendment to the report
    for the particular transaction should not be necessary.  In regard to the second
    matter, you have requested an amendment on Schedule B supporting Lien 23 providing
    the office sought by the Federal candidate.  The necessary changes have been made
    and an amended report has been filed with the FEC by electronic mail.  Thank you
    for bringing these matters to our attention.  If you have any questions or require
    additional information, please do not hesitate to contact me at 202-828-5870."'
